<!DOCTYPE html>
<html>
  <head>
    <meta charset="utf-8" />
    <title>404</title>
    <meta http-equiv="refresh" content="0; url=/rdo-smart-report-33/" />
    <script>
      // Store the originally requested path so index.html can restore it
      (function () {
        var l = window.location;
        var path = l.pathname.replace(/^\/rdo-smart-report-33/, "");
        var data = { path: path + l.search + l.hash };
        sessionStorage.setItem("gh_redirect", JSON.stringify(data));
        l.replace("/rdo-smart-report-33/");
      })();
    </script>
  </head>
  <body></body>
  </html>
